import React, { useState } from 'react';
import Garden_plants from "./Garden";

export default function ActionLink() {
    const [listeGarden, setlisteGarden] = useState([<Garden_plants />])
    function handleClick(e) {
        e.preventDefault();
        let Gardens = [...listeGarden, <Garden_plants />]
        setlisteGarden(Gardens);
    }

    return (
        <div>
            <div>
                {listeGarden.map((garden, index) => {
                    return <div key={index}>{garden}</div>
                })}
            </div>
            <button className="btn btn-primary mt-5" onClick={handleClick}>
                Add a garden
            </button>
        </div>
    );
}
